import React from 'react';
import NavBar from './components/leyout/NavBar.jsx';
import Inicio from './components/leyout/Inicio.jsx';
import Galeria from './components/Galeria/Galeria.jsx';

const App = () => {
  return (
    <React.Fragment>
      <NavBar />
      <div className='container'>
      <Inicio />
      <Galeria/>
      </div>
    </React.Fragment>
  );
}

export default App;
